	(1,'Store Name','STORE_NAME','instashopDev','The name of my store',1,1,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(2,'Store Owner','STORE_OWNER','josh','The name of my store owner',1,2,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(3,'Telephone - Customer Service','STORE_TELEPHONE_CUSTSERVICE','','Enter a telephone number for customers to reach your Customer Service department. This number may be sent as part of payment transaction details.',1,3,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(4,'Country','STORE_COUNTRY','223','The country my store is located in <br /><br /><strong>Note: Please remember to update the store zone.</strong>',1,6,NULL,'2013-05-28 13:11:51','zen_get_country_name','zen_cfg_pull_down_country_list('),
	(5,'Zone','STORE_ZONE','16','The zone my store is located in',1,7,NULL,'2013-05-28 13:11:51','zen_cfg_get_zone_name','zen_cfg_pull_down_zone_list('),
	(6,'Expected Sort Order','EXPECTED_PRODUCTS_SORT','desc','This is the sort order used in the expected products box.',1,8,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'asc\', \'desc\'), '),
	(7,'Expected Sort Field','EXPECTED_PRODUCTS_FIELD','date_expected','The column to sort by in the expected products box.',1,9,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'products_name\', \'date_expected\'), '),
	(8,'Switch To Default Language Currency','USE_DEFAULT_LANGUAGE_CURRENCY','false','Automatically switch to the language\'s currency when it is changed',1,10,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(9,'Language Selector','LANGUAGE_DEFAULT_SELECTOR','Default','Should the default language be based on the Store preferences, or the customer\'s browser settings?<br /><br />Default: Store\'s default settings',1,11,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'Default\', \'Browser\'), '),
	(10,'Use Search-Engine Safe URLs (still in development)','SEARCH_ENGINE_FRIENDLY_URLS','false','Use search-engine safe urls for all site links',6,12,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(11,'Display Cart After Adding Product','DISPLAY_CART','true','Display the shopping cart after adding a product (or return back to their origin)',1,14,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(12,'Default Search Operator','ADVANCED_SEARCH_DEFAULT_OPERATOR','and','Default search operators',1,17,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'and\', \'or\'), '),
	(13,'Store Address and Phone','STORE_NAME_ADDRESS','Store Name\r\n Address\r\n Country\r\n Phone','This is the Store Name, Address and Phone used on printable documents and displayed online',1,7,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_textarea('),
	(14,'Show Category Counts','SHOW_COUNTS','true','Count recursively how many products are in each category',1,19,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(15,'Tax Decimal Places','TAX_DECIMAL_PLACES','0','Pad the tax value this amount of decimal places',1,20,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(16,'Display Prices with Tax','DISPLAY_PRICE_WITH_TAX','false','Display prices with tax included (true) or add the tax at the end (false)',1,21,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(17,'Display Prices with Tax in Admin','DISPLAY_PRICE_WITH_TAX_ADMIN','false','Display prices with tax included (true) or add the tax at the end (false) in Admin(Invoices)',1,21,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(18,'Basis of Product Tax','STORE_PRODUCT_TAX_BASIS','Shipping','On what basis is Product Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone',1,21,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), '),
	(19,'Basis of Shipping Tax','STORE_SHIPPING_TAX_BASIS','Shipping','On what basis is Shipping Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone - Can be overriden by correctly written Shipping Module',1,21,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), '),
	(20,'Sales Tax Display Status','STORE_TAX_DISPLAY_STATUS','0','Always show Sales Tax even when amount is $0.00?<br />0= Off<br />1= On',1,21,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'0\', \'1\'), '),
	(21,'Show Split Tax Lines','SHOW_SPLIT_TAX_CHECKOUT','false','If multiple tax rates apply, show each rate as a separate line at checkout',1,22,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(22,'Admin Session Time Out in Seconds','SESSION_TIMEOUT_ADMIN','900','Enter the time in seconds.<br />Max allowed is 900 for PCI Compliance Reasons.<br /> Default=900<br />Example: 900= 15 min <br /><br />Note: Too few seconds can result in timeout issues when adding/editing products',1,40,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'900\', \'600\', \'300\'), '),
	(23,'Admin Set max_execution_time for processes','GLOBAL_SET_TIME_LIMIT','60','Enter the time in seconds for how long the max_execution_time of processes should be. Default=60<br />Example: 60= 1 minute<br /><br />Note: Changing the time limit is only needed if you are having problems with the execution time of a process',1,42,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(24,'Show if version update available','SHOW_VERSION_UPDATE_IN_HEADER','false','Automatically check to see if a new version of Zen Cart is available. Enabling this can sometimes slow down the loading of Admin pages. (Displayed on main Index page after login, and Server Info page.)',1,44,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(25,'Store Status','STORE_STATUS','0','What is your Store Status<br />0= Normal Store<br />1= Showcase no prices<br />2= Showcase with prices',1,25,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'0\', \'1\', \'2\'), '),
	(26,'Server Uptime','DISPLAY_SERVER_UPTIME','true','Displaying Server uptime can cause entries in error logs on some servers. (true = Display, false = don\'t display)',1,46,'2003-11-08 20:24:47','0001-01-01 00:00:00','','zen_cfg_select_option(array(\'true\', \'false\'),'),
	(27,'Missing Page Check','MISSING_PAGE_CHECK','Page Not Found','Zen Cart can check for missing pages in the URL and redirect to Index page. For debugging you may want to turn this off. <br /><br /><strong>Default=On</strong><br />On = Send missing pages to \'index\'<br />Off = Don\'t check for missing pages<br />Page Not Found = display the Page-Not-Found page',1,48,'2003-11-08 20:24:47','0001-01-01 00:00:00','','zen_cfg_select_option(array(\'On\', \'Off\', \'Page Not Found\'),'),
	(28,'cURL Proxy Status','CURL_PROXY_REQUIRED','False','Does your host require that you use a proxy for cURL communication?',6,50,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'True\', \'False\'), '),
	(29,'cURL Proxy Address','CURL_PROXY_SERVER_DETAILS','','If you have a hosting service that requires use of a proxy to talk to external sites via cURL, enter their proxy address here.<br />format: address:port<br />ie: 127.0.0.1:3128',6,51,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(30,'HTML Editor','HTML_EDITOR_PREFERENCE','NONE','Please select the HTML/Rich-Text editor you wish to use for composing Admin-related emails, newsletters, and product descriptions',1,110,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_pull_down_htmleditors('),
	(31,'Enable phpBB linkage?','PHPBB_LINKS_ENABLED','false','Should Zen Cart synchronize new account information to your (already-installed) phpBB forum?',1,120,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),'),
	(32,'Show Category Counts - Admin','SHOW_COUNTS_ADMIN','true','Show Category Counts in Admin?',1,19,NULL,'2013-05-28 13:11:51',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), '),
	(33,'Currency Conversion Ratio','CURRENCY_UPLIFT_RATIO','1.05','When auto-updating currencies, what \"uplift\" ratio should be used to calculate the exchange rate used by your store?<br />ie: the bank rate is obtained from the currency-exchange servers; how much extra do you want to charge in order to make up the difference between the bank rate and the consumer rate?<br /><br /><strong>Default: 1.05 </strong><br />This will cause the published bank rate to be multiplied by 1.05 to set the currency rates in your store.',1,55,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(34,'First Name','ENTRY_FIRST_NAME_MIN_LENGTH','2','Minimum length of first name',2,1,NULL,'2013-05-28 13:11:51',NULL,NULL),
	(35,'Last Name','ENTRY_LAST_NAME_MIN_LENGTH','2','Minimum length of last name',2,2,NULL,'2013-05-28 13:11:51',NULL,NULL),
